//import React from 'react'
import React, { Fragment } from 'react'


function projectCard(project) {
    return (
        <Fragment>
    <figure>
                <img  src={project.pjImg} alt="placeholder" style={{height:"400px", width:"600px"}}></img>
            </figure>
            <div className="ml-25">
                <h2>
                    {project.project}
                </h2>
                <p>
                    {project.desc}
                </p>
                <img src="https://github.githubassets.com/images/modules/logos_page/GitHub-Logo.png" href={project.git} style={{height:"50px", width:"80px"}}></img> 


            </div> 
            <hr></hr>
        </Fragment>
    )
}

export default projectCard
